A Thank You Post to the ones who made me look and feel beautiful on one my most special days✨️💜💫

These 3 Sarees - all bought from @kalkifashion were my Main Wedding Sarees

Hence the blouses had to be extraordinary and well I found this sweet person @vibhabondre who was kind enough to do an amazing job in a very short time. The intricate work and detailing were so beautiful that it brought the sarees alive. She made sure each blouse was Special and Perfectly fitted especially since I didn't even have time for a trial.

@krutika_makeovers the amount I love and admire this girl is something I can't put in words completely. Her talent, her work and her dedication towards it is amazing. Her detailing and intricacy in her mehendi designs is mesmerising. The hair, makeup and dressing style were beautiful undoubtedly but the reason I love this girl more is because she stood by me throughout when I needed it the most during that period and helped in whatever way possible.

@eternal_captures_byakhil the man with the lens, who creates magic with his photographs so much so that you relive those moments everytime you see the pics. Without you, your team, @krishna_devate and @hustlerandmonkweddingfilms the chaos we were in during that period would have been a bigger mess than it had been. The way y'all supported us, went through our problems like your own and made sure we looked good for the camera is something we'll never forget.

@creative_eye_events thank you for turning my wedding into a fairytale event. You made all our venues beautiful and managed everything perfectly without us having to worry about the minute details as well.

Thank you to each one of you, when I think back now - I really don't know how we would have been able to manage without any of you.
Eternally grateful 🙏

#weddingday #weddingstory #specialday #grateful #thankful #goodvibe #positivevibes
